#include <vector>
 
using namespace std;
 
const int MaxN = 57, NA = -1, MaxC = 0x3F3F3F3F;
 
class FlipGame
{
private:
 bool a [MaxN] [MaxN];
 int m, n;
 
public:
 int minOperations (vector <string> board)
 {
  int i, j, k, res;
  bool ok;
 
  m = board.size ();
  n = board[0].size ();
  for (i = 0; i < m; i++)
   for (j = 0; j < n; j++)
    a[i][j] = (board[i][j] == '1');
 
  for (res = 0; ; res++)
  {
   ok = false;
   k = 0;
   for (i = 0; i < m; i++)
   {
    for (j = 0; j < n; j++)
     if (a[i][j])
     {
      ok = true;
      k = max (k, j + 1);
     }
    for (j = 0; j < k; j++)
     a[i][j] ^= 1;
   }
   if (!ok)
    break;
  }
 
  return res;
 }
};
 
 
